import React from 'react';

import Header from '../../header';
import Slider from "./slider"
import '../../../css/pages/home/homeMain.scss'

function Home() {
    const [cars, setCars] = React.useState([]);

    React.useEffect(()=>{
      fetch('https://66084611a2a5dd477b14432d.mockapi.io/api/iktzap/CARS')
      .then((res) => {
        return res.json();
      })
      .then((json) => {
        setCars(json);
    });
}, []);

  return (
    <>
    <Header/>
    <div className="homeMain">
        <div className="container">
            <div className="item">
                <div className="slider">
                    {cars.map((obj) => {
                        <Slider
                            name={obj.name}
                            spisok={obj.spisok}
                            link={obj.link}
                            img={obj.images}
                        />
                    })
                }
                {console.log('this is cars', cars)}
                <div className="button">
                    <img className='left' src="img/right.svg" alt="" />
                    <img className='right' src="img/right.svg" alt="" />
                </div>
                </div>
            </div>
        </div>
    </div>
    </>
  )
}


export default Home;
